#  CSV loading utilities
# ----------------------------------------------------------------------
def fetch_table_columns(cur, table_name):
    """Return an ordered list of column names for a table."""
    cur.execute(f"SHOW COLUMNS FROM `{table_name}`;")
    return [row[0] for row in cur.fetchall()]

# synonyms for header alignment
SYNONYMS = {
    "stg_s8_risk_linked": {
        "cause_name": "cause_name",
        "disease": "cause_name",
    },
}

def align_df_to_table(cur, df, table):
    """
    Align DataFrame columns to match the DB table, including synonyms.
    - rename old headers (e.g. disease -> cause_name for S8)
    - add missing columns as None
    - reorder to table definition
    """
    cols = fetch_table_columns(cur, table)
    # handle synonyms for S8
    if table in SYNONYMS:
        if table == "stg_s8_risk_linked":
            if "disease" in cols and "cause_name" not in cols and "cause_name" in df.columns:
                df = df.rename(columns={"cause_name": "disease"})
            elif "cause_name" in cols and "cause_name" not in df.columns and "disease" in df.columns:
                df = df.rename(columns={"disease": "cause_name"})
        else:
            syn = SYNONYMS[table]
            df = df.rename(columns={c: syn.get(c, c) for c in df.columns})
    # add missing
    for col in cols:
        if col not in df.columns:
            df[col] = None
    # drop extras and reorder
    return df[cols]

def _to_py(v):
    """
    Convert pandas/numpy types to Python types or None.
    """
    if v is None:
        return None
    if isinstance(v, float) and math.isnan(v):
        return None
    try:
        if pd.isna(v):
            return None
    except Exception:
        pass
    if isinstance(v, np.generic):
        return v.item()
    if isinstance(v, pd.Timestamp):
        return v.to_pydatetime()
    if isinstance(v, (datetime, date)):
        return v
    return v

def chunked_insert_dataframe(cur, df: pd.DataFrame, table: str, batch=2000):
    """
    Insert DataFrame into MySQL table in batches, converting to Python types.
    """
    if df.empty:
        return 0
    df = df.where(pd.notna(df), None).astype(object)
    cols = list(df.columns)
    cols_sql = ", ".join(f"`{c}`" for c in cols)
    placeholders = ", ".join(["%s"] * len(cols))
    sql = f"INSERT INTO {table} ({cols_sql}) VALUES ({placeholders})"
    total = 0
    rows = []
    for row in df.itertuples(index=False, name=None):
        rows.append(tuple(_to_py(v) for v in row))
        if len(rows) >= batch:
            cur.executemany(sql, rows)
            total += len(rows)
            rows = []
    if rows:
        cur.executemany(sql, rows)
        total += len(rows)
    return total

def load_csv_to_staging(cur, file_items):
    """
    Load each CSV defined in YAML into its staging table with header alignment.
    """
    total_inserted = 0
    for item in file_items:
        path = item["path"]
        table = item["staging"]
        if not path or not os.path.exists(path):
            print(f"SKIP: {table} — file not found: {path}")
            continue
        print(f"Loading {path} -> {table}")
        # read as strings for robust type detection
        df = pd.read_csv(path, dtype=str, keep_default_na=True, na_values=["", "NA", "NaN"])
        # special pre-processing for biomarker CSVs
        if table in ("stg_biomarkers_kidney", "stg_biomarkers_liver"):
          df = preprocess_biomarker_df(table, df)
        elif table == "stg_nhs_cube09":  
          df = preprocess_nhs_cube_df(df)
        # numeric columns auto-detected (best effort)
        for c in df.columns:
            series = df[c].dropna()
            if series.shape[0] and all(str(v).replace(".", "", 1).replace("-", "", 1).isdigit() for v in series.head(20)):
                try:
                    df[c] = pd.to_numeric(df[c], errors="coerce")
                except Exception:
                    pass
        df = align_df_to_table(cur, df, table)
        inserted = chunked_insert_dataframe(cur, df, table)
        total_inserted += inserted
        print(f"  inserted {inserted} rows")
    return total_inserted

